  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "## Steps Followed in this Linear regression model\n",
    "-  Importing and understanding the data\n",
    "-  Data Cleaning (Check for duplicate values, null values, deriving car company from car name)\n",
    "-  EDA Analysis-- performed visualization on both categorical and continuus numerical variables to understand better\n",
    "-  Effort has been made to detect outliers but the outliers have not been dropped so as to avoid data loss\n",
    "-  Derived averagempg from citympg and highwaympg\n",
    "-  Binning has been applied to Symobling, enginetype, cylindernumber and fuelsystem to reduce the number of dummy   varaibles which will be created subsequently and also to have a lean model\n",
    "-  Mapped the binary variables having two denominations as 0 and 1 and created dummy variables for the categorical variables which had more than 2 denominations\n",
    "- In the Modelling phase, the train and test data splits have been performed with a 70 to 30 ratio\n",
    "-  The numerical features are rescalled using the minmax scaler so that the min value would be 0 and max value would be 1. The scaling transformation has not been applied on the categorical features so as to retain the interpretation capability\n",
    "- There were 50 independent variables. So the Recursive Feature elimination has been used to select the top 15 features\n",
    "- Using the 15 features obtained as a result of RFE, the models were built using the statsmodel, for the detailed statistics\n",
    "- There were 12 models built, to arrive at the best model, after dropping one variable at a time due to insignificance (high p-values) or high Variance Inflation factor.\n",
    "- After arriving at the best model i.e. 12th model, a residual analysis on the training data was performed to validate the assumptions of liner regression and the errors were normally distributed\n",
    "-  The final model object was used to predict the values on the test set\n",
    "- Model Evaluation was perfomred to see the differences between y_test and the y_pred\n",
    "-  R-squared on the test set was calculated as 0.8293692630567879 which is almost equal to the r-squared observed on the training set  with a r-squared score of 0.829 and  adjsuted r-squared score of 0.824"
   ]
  }
